INSERT INTO `contents` (`id`, `title`, `description`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1,	'About us',	'<p><em><strong>AZ On Wheels</strong></em></p>\r\n\r\n<p><em><strong>&quot;AZ On Wheels&quot;</strong>&nbsp;is a newly established food delivery business located in St Louis, Missouri. The company will have an online platform that will also be able to be downloaded to users&rsquo; phones as an app. Users will be able to create a login profile and have instant access to all the local restaurants, bakeries, grocery stores, and fast-food establishments.</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em>The company will outsource its delivery to local drivers that will be employed as Independent Contractors so they will be able to set their own schedule and hours. The drivers will receive orders through their app, select which user they want to deliver to, pick up the food order from the chosen establishment, and deliver to the user in a timely manner.</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em><strong>&quot;AZ On Wheels&quot;&nbsp;</strong>will reward users that frequently use their app. Users will be able to earn rewards and discounts for every order they place through the website or app. This will enable users to keep ordering their food delivery through &quot;<strong>AZ On Wheels&quot;</strong>.</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&quot;AZ On Wheels&quot;</strong>&nbsp;will be owned and operated by Velly Duverny, a local entrepreneur. At this point, he has perfected the technology and is ready to reveal the new local food delivery service in St Louis, Missouri.</p>',	1,	'2023-03-27 05:17:18',	'2023-10-07 16:21:57',	NULL),
(2,	'Terms and Conditions',	'<p>Last modified: 10/15/2023</p>\r\n\r\n<p>AZ On Wheels Terms and Conditions<br />\r\nContents</p>\r\n\r\n<p><br />\r\n1. Item availability</p>\r\n\r\n<p>2. Alcohol Items</p>\r\n\r\n<p>3. Arbitration Agreement</p>\r\n\r\n<p><br />\r\n==========================================================================================================</p>\r\n\r\n<p>1.a. Item availability.<br />\r\nThe Merchant must make Items available for purchase through the AZ Platforms during its normal business hours and ensure the menu of available Items is accurate.</p>\r\n\r\n<p>1.b. Item standards and accuracy.<br />\r\nThe Merchant must:</p>\r\n\r\n<p>1.b.i. prepare, handle, store, label, and package all Items in accordance with applicable Laws, including without limitation Food Safety Standards, Laws related to the Items or packaging materials used, and, if applicable, Alcohol Safety Standards;</p>\r\n\r\n<p>1.b.ii. when using the AZ Tools, or otherwise making Items available through the AZ Platforms, identify Items correctly, particularly where the Items may be subject to age restrictions or identification requirements (e.g., tagging Alcohol Items, pharmaceutical Items);</p>\r\n\r\n<p>1.b.iii. determine any Item Criteria, and is responsible for ensuring that all Items meet the applicable Item Criteria;</p>\r\n\r\n<p>1.b.iv. ensure that the contents of its menu includes the Item Criteria for each Item (including any notifications about ingredients, nutritional information, allergen information, alcoholic content (if applicable), etc.), which are accurate and comply with all applicable Laws; and</p>\r\n\r\n<p>1.b.v. where the Customer may need to prepare, use, or assemble Items in a particular way, include instructions for such preparation, use, or assembly of the Items which are accurate and comply with all applicable Laws.</p>\r\n\r\n<p>1.c. Item packaging and labeling.<br />\r\nThe Merchant must package Items appropriately for delivery, including:</p>\r\n\r\n<p>1.c.i. ensuring that Items provided to a Delivery Person are collectively able to fit into, and are appropriate for transport in a standard midsize motor vehicle and do not exceed 50 pounds per package, box, or parcel;</p>\r\n\r\n<p>1.c.ii. any protection necessary to prevent tampering or damage due to any cause, including inclement weather or the nature of the Items themselves;</p>\r\n\r\n<p>1.c.iii. using appropriate preservation methods (e.g., dry ice, gel pack, bubble wrap) to ensure that the Items arrive as intended by the Merchant, as reasonably expected by the Customer, and that the specific Item is delivered in a safe condition, including, where applicable, being safe for consumption; and</p>\r\n\r\n<p>1.c.iv. providing any certifications, labeling, protection, or instructions:</p>\r\n\r\n<p>1.c.iv.A. required by Laws;</p>\r\n\r\n<p>1.c.iv.B. appropriate for the Customer to properly and safely use, handle, or consume Items;</p>\r\n\r\n<p>1.c.iv.C. prevent tampering or damage due to any cause, including inclement weather; or</p>\r\n\r\n<p>1.c.iv.D. appropriate for the Customer to use, handle, or dispose of any packaging materials,</p>\r\n\r\n<p>including in the case of Alcohol Items, where required, a statement that the package contains alcohol and may only be delivered to a person 21 years or older with valid proof of age and identity.</p>\r\n\r\n<p><br />\r\n2.OUR ALCOHOLIC BEVERAGES POLICY<br />\r\nSome jurisdictions permit the ordering and delivery of alcoholic beverages. In such jurisdictions, if you place an order that includes any alcoholic beverage, you represent and warrant that you are at least 21 years of age. Upon delivery or pickup, as applicable, you shall present a government-issued identification card, evidencing your age, consistent with applicable legal requirements. The Delivery Partner may electronically scan the identification card of the individual receiving the order to confirm that the recipient is at least 21 years of age and the delivery may be completed. You also agree that our Delivery Partners may withhold delivery of the alcoholic beverages if you appear or the recipient of the delivery appears intoxicated when receiving delivery of such products. If you do not comply with these terms, you agree that the alcoholic beverage(s) will not be released to you, you may forfeit the cost of such beverages, and you may be responsible for restocking fees.</p>\r\n\r\n<p>3. Dispute Resolution &amp; Arbitration Agreement<br />\r\n3.1. Overview of Dispute Resolution Process: This Section 3 provides for a two-part process for dispute resolution: (1) an informal dispute resolution process directly with AZ On Wheels (described in paragraph 3.2, below), and if necessary, (2) a binding arbitration administered by the American Arbitration Association (&ldquo;AAA&rdquo;) or ADR Services Inc. (&ldquo;ADR Services&rdquo;), depending on where you reside. Notwithstanding these provisions, you and AZ On Wheels each retain the right to seek resolution of disputes in small claims court as an alternative to arbitration.</p>\r\n\r\n<p>3.2. Mandatory Informal Dispute Resolution: You and AZ On Wheels agree that good-faith informal efforts to resolve disputes often can result in a prompt, low-cost and mutually beneficial outcome. Therefore, before initiating formal proceedings, you and AZ On Wheels agree to first attempt to work out any such dispute amicably. The initiating party must give notice to the other party in writing of its, his, or her dispute, including a written description of the dispute.&nbsp;</p>\r\n\r\n<p>For any dispute you initiate, you agree to provide written notice to:<br />\r\nour written description must be on an individual basis and personally signed by you and not by an attorney, agent, or representative. The notice must also provide at least the following information: your name; the email address associated with your account; a detailed description of the nature and basis of the dispute, including any transaction details; and the specific relief sought and how it was calculated. For any dispute that AZ On Wheels raises, we will send our written description of the dispute (including the information listed above), signed by an authorized AZ On Wheels representative, to the most recent delivery address associated with your account. The initiating party must allow the other party 60 days to respond and attempt to resolve the dispute amicably before initiating an arbitration or other proceeding per the terms set forth below.</p>\r\n\r\n<p>You and AZ On Wheels agree that this informal dispute resolution process is a requirement that must be fulfilled prior to initiating an arbitration or small claims proceeding. The applicable statute of limitations period and any filing fee deadlines shall be tolled from the time the initiating party sends their written notice through the 60 day period set forth above.</p>\r\n\r\n<p>3.3. &nbsp;Arbitration Agreement for United States Residents: &nbsp;For residents of the United States, if we&rsquo;re unable to work out a solution amicably, both you and AZ On Wheels agree to resolve through binding arbitration, rather than in court, any dispute, controversy, or claim (each, a &ldquo;Claim&rdquo;) arising at any time, including but not limited to those arising out of or relating to: (i) these Terms, including the formation, existence, breach, termination, enforcement, interpretation, validity, scope, or enforceability thereof; (ii) access to or use of the Services, including receipt of any advertising or marketing communications and/or any information contained on the Services; (iii) any transactions through, by, or using the Services, including any goods or services purchased or sold through, by, or using the Services and any consumption or use of those goods and services; (iv) any other aspect of your relationship or transactions with AZ On Wheels as a consumer; or (v) Third Party Disputes (as defined in Section 3.4 below) (the &ldquo;Arbitration Agreement&rdquo;). &nbsp;</p>\r\n\r\n<p>This Arbitration Agreement shall apply, without limitation, to all claims that arose or were asserted before the Effective Date of these Terms.&nbsp;</p>\r\n\r\n<p>3.4. Application to Third Parties: This Arbitration Agreement shall be binding upon, and shall include any dispute, controversy, or claim brought by or against any third parties where the underlying claims arise out of or relate to your use of the Services or any use of your AZ On Wheels user account (&ldquo;Third Party Disputes&rdquo;). Third Party Disputes shall include any dispute, controversy, or claim by or against any Retailers, Third-Party Providers, AZ On Wheels&rsquo;s vendors and service providers including without limitation: payment processors, partners assisting in fraud prevention, companies advertising through the Services, partners with whom we work for advertising measurement, attribution and/or analytics, and companies that offer co-branded services or products, as well as your spouses, heirs, third-party beneficiaries and assigns.. For avoidance of doubt, a Claim under this Arbitration Agreement includes all claims or disputes between you and any Retailer arising out of or related to the Services performed under this Agreement and/or services in connection with any white label sites that are powered by AZ On Wheels.&nbsp;</p>\r\n\r\n<p>3.1. Exceptions to Arbitration Agreement: Notwithstanding this mandatory Arbitration Agreement, you and AZ On Wheels each retain the right: (a) to assert claims in small claims court, so long as the claims qualify and the matter remains in such court and advances only on an individual (non-class, non-representative) basis; and, (b) to seek injunctive or other equitable relief in a court of competent jurisdiction to prevent the actual or threatened infringement of a party&rsquo;s intellectual property rights. If a Claim qualifies for small claims court but a party commences an arbitration proceeding, you and AZ On Wheels agree that either party may elect instead to have the Claim resolved in small claims court, and upon written notice of a party&#39;s election, the arbitration proceeding will be administratively closed. &nbsp;Any dispute about whether a Claim qualifies for small claims court shall be resolved by that court, not by an arbitrator.</p>',	1,	'2023-03-27 05:17:18',	'2023-12-06 06:40:49',	NULL),
(3,	'Privacy & Policy',	'<p><strong>Privacy and Policy</strong></p>\r\n\r\n<p>ONLINE PRIVACY POLICY AGREEMENT October 7, 2023 AZ On Wheels ( AZ) values its users&#39; privacy. This Privacy Policy (&quot;Policy&quot;) will help you understand how we collect and use personal information from those who visit our website or make use of our online facilities and services, and what we will and will not do with the information we collect. Our Policy has been designed and created to assure those affiliated with AZ On Wheels of our commitment and realization of our obligation not only to meet, but to exceed, most existing privacy standards.</p>\r\n\r\n<p>We reserve the right to make changes to this Policy at any given time. If you have not registered with us and want to make sure that you are up to date with the latest changes, we advise you to frequently visit this page. If you are a registered user, we will notify you via email of any changes or updates made to this Policy. If at any point in time AZ On Wheels decides to make use of any personally identifiable information on file, in a manner vastly different from that which was stated when this information was initially collected, the user or users shall be promptly notified by email. Users at that time shall have the option as to whether to permit the use of their information in this separate manner.</p>\r\n\r\n<p>This Policy applies to AZ On Wheels, and it governs any and all data collection and usage by us. Through the use of azonwheels.com, you are therefore consenting to the data collection procedures expressed in this Policy.</p>\r\n\r\n<p>Please note that this Policy does not govern the collection and use of information by companies that AZ On Wheels does not control, nor by individuals not employed or managed by us. If you visit a website that we mention or link to, be sure to review its privacy policy before providing the site with information. It is highly recommended and suggested that you review the privacy policies and conditions of any website you choose to use or frequent to better understand the way in which websites garner, make use of and share the information collected.</p>\r\n\r\n<p>Specifically, this Policy will inform you of the following</p>\r\n\r\n<p>1. What personally identifiable information is collected from you through our website;</p>\r\n\r\n<p>2. Why we collect personally identifiable information and the legal basis for such collection;</p>\r\n\r\n<p>3. How we use the collected information and with whom it may be shared;</p>\r\n\r\n<p>4. What choices are available to you regarding the use of your data; and</p>\r\n\r\n<p>5. The security procedures in place to protect the misuse of your information.</p>\r\n\r\n<p><strong>Information We Collect</strong></p>\r\n\r\n<p>It is always up to you whether to disclose personally identifiable information to us, although if you elect not to do so, we reserve the right not to register you as a user or provide you with any products or services. This website collects various types of information, such as:</p>\r\n\r\n<p>● Voluntarily provided information which may include your name, address, email address, billing and/or credit card information etc. which may be used when you purchase products and/or services and to deliver the services you have requested.</p>\r\n\r\n<p>● Information automatically collected when visiting our website, which may include cookies, third party tracking technologies and server logs.</p>\r\n\r\n<p>In addition, AZ On Wheels may have the occasion to collect non-personal anonymous demographic information, such as age, gender, household income, political affiliation, race and religion, as well as the type of browser you are using, IP address, or type of operating system, which will assist us in providing and maintaining superior quality service.</p>\r\n\r\n<p>AZ On Wheels may also deem it necessary, from time to time, to follow websites that our users may frequent to gleam what types of services and products may be the most popular to customers or the general public.</p>\r\n\r\n<p>Please rest assured that this site will only collect personal information that you knowingly and willingly provide to us by way of surveys, completed membership forms, and emails. It is the intent of this site to use personal information only for the purpose for which it was requested, and any additional uses specifically provided for in this Policy.</p>\r\n\r\n<p><strong>Why We Collect Information and For How Long </strong></p>\r\n\r\n<p>We are collecting your data for several reasons:</p>\r\n\r\n<p>● To better understand your needs and provide you with the services you have requested;</p>\r\n\r\n<p>● To fulfill our legitimate interest in improving our services and products;</p>\r\n\r\n<p>● To send you promotional emails containing information we think you may like when we have your consent to do so;</p>\r\n\r\n<p>● To contact you to fill out surveys or participate in other types of market research, when we have your consent to do so;</p>\r\n\r\n<p>● To customize our website according to your online behavior and personal preferences.</p>\r\n\r\n<p>The data we collect from you will be stored for no longer than necessary. The length of time we retain said information will be determined based upon the following criteria: the length of time your personal information remains relevant; the length of time it is reasonable to keep records to demonstrate that we have fulfilled our duties and obligations; any limitation periods within which claims might be made; any retention periods prescribed by law or recommended by regulators, professional bodies or associations; the type of contract we have with you, the existence of your consent, and our legitimate interest in keeping such information as stated in this Policy.</p>\r\n\r\n<p><strong>Use of Information Collected</strong></p>\r\n\r\n<p>AZ On Wheels does not now, nor will it in the future, sell, rent or lease any of its customer lists and/or names to any third parties. AZ On Wheels may collect and may make use of personal information to assist in the operation of our website and to ensure delivery of the services you need and request. At times, we may find it necessary to use personally identifiable information as a means to keep you informed of other possible products and/or services that may be available to you from azonwheels.com</p>\r\n\r\n<p>AZ On Wheels may also be in contact with you with regards to completing surveys and/or research questionnaires related to your opinion of current, potential, or future services that may be offered.</p>\r\n\r\n<p>AZ On Wheelsuses various third-party social media features including but not limited to and other interactive programs. These may collect your IP address and require cookies to work properly.These services are governed by the privacy policies of the providers and are not within AZ On Wheels&#39;s control.</p>\r\n\r\n<p><strong>Disclosure of Information</strong></p>\r\n\r\n<p>AZ On Wheels may not use or disclose the information provided by you except under the following circumstances:</p>\r\n\r\n<p>● as necessary to provide services or products you have ordered;</p>\r\n\r\n<p>● in other ways described in this Policy or to which you have otherwise consented;</p>\r\n\r\n<p>● in the aggregate with other information in such a way so that your identity cannot reasonably be determined;</p>\r\n\r\n<p>● as required by law, or in response to a subpoena or search warrant;</p>\r\n\r\n<p>● to outside auditors who have agreed to keep the information confidential;</p>\r\n\r\n<p>● as necessary to enforce the Terms of Service on our website;</p>\r\n\r\n<p>● as necessary to maintain, safeguard and preserve all the rights and property of AZ On Wheels.</p>\r\n\r\n<p><strong>Non-Marketing Purposes</strong></p>\r\n\r\n<p>AZ On Wheelsgreatly respects your privacy. We do maintain and reserve the right to contact you if needed for non-marketing purposes (such as bug alerts, security breaches, account issues, and/or changes in AZ On Wheels products and services, or changes to this Policy). In certain circumstances, we may use our website, newspapers, or other public means to post a notice.</p>\r\n\r\n<p><strong>Children under the age of 13</strong></p>\r\n\r\n<p>AZ On Wheels&#39;s website is not directed to, and does not knowingly collect personal identifiable information from, children under the age of thirteen (13). If it is determined that such information has been inadvertently collected on anyone under the age of thirteen (13), we shall immediately take the necessary steps to ensure that such information is deleted from our system&#39;s database, or in the alternative, that verifiable parental consent is obtained for the use and storage of such information. Anyone under the age of thirteen (13) must seek and obtain parent or guardian permission to use this website.</p>\r\n\r\n<p><strong>Unsubscribe or Opt-Out</strong></p>\r\n\r\n<p>All users and visitors to our website have the option to discontinue receiving communications from us by way of email or newsletters. To discontinue or unsubscribe from our website please send an email that you wish to unsubscribe to contact@azonwheels.com. If you wish to unsubscribe or opt-out from any third-party websites, you must go to that specific website to unsubscribe or opt-out. AZ On Wheels will continue to adhere to this Policy with respect to any personal information previously collected.</p>\r\n\r\n<p><strong>Links to Other Websites</strong></p>\r\n\r\n<p>Our website does contain links to affiliate and other websites. AZ On Wheels does not claim nor accept responsibility for any privacy policies, practices and/or procedures of other websites. Therefore, we encourage all users and visitors to be aware when they leave our website and to read the privacy statements of every website that collects personally identifiable information. This Policy applies only and solely to the information collected by our website.</p>\r\n\r\n<p><strong>Notice to European Union Users</strong></p>\r\n\r\n<p>AZ On Wheels&#39;s operations are located primarily in the United States. If you provide information to us, the information will be transferred out of the European Union (EU) and sent to the United States. (The adequacy decision on the EU-US Privacy became operational on August 1, 2016. This framework protects the fundamental rights of anyone in the EU whose personal data is transferred to the United States for commercial purposes. It allows the free transfer of data to companies that are certified in the US under the Privacy Shield.) By providing personal information to us, you are consenting to its storage and use as described in this Policy.</p>\r\n\r\n<p><strong>Security</strong></p>\r\n\r\n<p>AZ On Wheels takes precautions to protect your information. When you submit sensitive information via the website, your information is protected both online and offline. Wherever we collect sensitive information (e.g. credit card information), that information is encrypted and transmitted to us in a secure way. You can verify this by looking for a lock icon in the address bar and looking for &quot;https&quot; at the beginning of the address of the webpage.</p>\r\n\r\n<p>While we use encryption to protect sensitive information transmitted online, we also protect your information offline. Only employees who need the information to perform a specific job (for example, billing or customer service) are granted access to personally identifiable information. The computers and servers in which we store personally identifiable information are kept in a secure environment. This is all done to prevent any loss, misuse, unauthorized access, disclosure or modification of the user&#39;s personal information under our control.</p>\r\n\r\n<p>The Company also uses Secure Socket Layer (SSL) for authentication and private communications to build users&#39; trust and confidence in the internet and website use by providing simple and secure access and communication of credit card and personal information.</p>\r\n\r\n<p><strong>Acceptance of Terms</strong></p>\r\n\r\n<p>By using this website, you are hereby accepting the terms and conditions stipulated within this Privacy Policy Agreement. If you are not in agreement with our terms and conditions, then you should refrain from further use of our sites. In addition, your continued use of our website following proper notification or the posting of any updates or changes to our terms and conditions, shall mean that you agree and accept such changes.</p>\r\n\r\n<p><strong>How to Contact Us</strong></p>\r\n\r\n<p>If you have any questions or concerns regarding this Privacy Policy as it relates to our website, please feel free to contact us at the following email, telephone number or mailing address:</p>\r\n\r\n<p>Email: Contact@azonwheels.com</p>\r\n\r\n<p>Mailing Address:</p>\r\n\r\n<p>AZ On Wheels</p>\r\n\r\n<p>PO Box 27612 Saint Louis,</p>\r\n\r\n<p>Missouri 63146</p>',	1,	'2023-03-27 05:17:18',	'2023-10-11 03:29:34',	NULL);
