INSERT INTO `faqs` (`id`, `question`, `answer`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1,	'hello here',	'dfgdfgdfgd',	'1',	'2023-10-03 00:42:56',	'2023-10-03 00:46:54',	'2023-10-03 00:46:54'),
(2,	'What is AZ On Wheels',	'AZ On Wheels is a technology company that connects businesses with customers in their area. By facilitating delivery and pickup orders, AZ On Wheels helps businesses reach new customers, increase brand awareness online, and ultimately grow.',	'1',	'2023-10-03 00:46:59',	'2023-10-11 02:29:23',	NULL),
(3,	'How do I browse restaurants near me?',	'The best way is to make sure you enter your address as specifically as possible. The search results will be tailored to restaurants that deliver to that address or restaurants that are within a reasonable distance offering pickup',	'1',	'2023-10-03 00:47:15',	'2023-10-11 02:36:08',	NULL),
(4,	'Is AZ available in my area?',	'The easiest way to check if AZ  is available in your area is to begin the self-signup process. If we do not service your area, we will notify you when that changes.',	'1',	'2023-10-12 02:57:06',	'2023-10-12 13:09:35',	NULL),
(5,	'Can I stop orders if it gets too busy?',	'Yes, AZ  partners can pause orders at any time. If your restaurant uses a tablet, you can pause your store from collecting orders for a specific time period. You can also indicate that your store is busy, letting customers know to expect longer prep times.',	'1',	'2023-10-12 02:57:30',	'2023-10-12 13:12:06',	NULL),
(6,	'How much I make doing AZ?',	'Typical income is $20-$25 an hour, but it is extremely dependent on where you are delivering, so don\'t take that as gospel.',	'1',	'2023-10-12 03:00:49',	'2023-10-12 03:00:49',	NULL),
(7,	'What is a flat fee?',	'AZ Drive connects your business with drivers to complete deliveries placed on your ordering platform. When customers order from your website, app, or other channels, we charge a flat per-order fee (not a commission percentage) for you to use AZ to deliver orders.',	'1',	'2023-10-12 13:13:42',	'2023-10-12 13:14:17',	NULL),
(8,	'How do I order?',	'You enter your address and click “Search.” You’ll see a list of restaurants delivering to you, along with nearby pickup options. Click the one you’re into, do the same for anything you’re feeling on its menu and hit “Proceed to Checkout.”Do that whole “ordering something on the Internet” checkout thing and we’ll notify the restaurant to begin prepping your food.',	'1',	'2023-10-12 13:18:32',	'2023-10-12 13:18:32',	NULL),
(9,	'How does ordering pickup work?',	'It’s exactly the same as ordering for delivery, minus the “delivery” part. Instead, the restaurant will let you know when to expect the food to be ready, and you’ll shuffle over to grab it and go. Please remember to have an ID handy when picking your food up. Restaurants like to make sure that their food is heading off with the proper person.',	'1',	'2023-10-12 13:22:55',	'2023-10-12 13:22:55',	NULL),
(10,	'Can you track your AZ driver?',	'When your AZ  driver has picked up your order, you will be able to track their location using the AZ app.',	'1',	'2023-10-12 13:25:55',	'2023-10-12 13:25:55',	NULL),
(11,	'Does AZ deliver at night?',	'AZ always delivers at night—if restaurants are open after midnight, AZ is delivering! Whether you\'re in the mood to eat pizza, Buffalo wings, or other favorite foods, order from restaurants near you for delivery from AZ.',	'1',	'2023-10-12 13:29:09',	'2023-10-12 13:29:09',	NULL);
